import React from 'react';
import styled from 'styled-components';

const StorySection = styled.section`
  min-height: 80vh;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  padding: 60px 20px;
  background: ${props => props.theme.surface};
`;

const Title = styled.h1`
  font-size: 2.5rem;
  margin-bottom: 1rem;
  color: ${props => props.theme.primary};
`;

const Text = styled.p`
  font-size: 1.2rem;
  max-width: 700px;
  color: ${props => props.theme.text};
  text-align: center;
`;

const MyStory = ({ theme }) => (
  <StorySection theme={theme}>
    <Title theme={theme}>My Story</Title>
    <Text theme={theme}>
      This is a placeholder for your personal story. Share your journey, background, and what drives your passion for technology and creativity!
    </Text>
  </StorySection>
);

export default MyStory;
